// 动态拼接dicomImageDiv
function dicomInnerInfo(index) {
	let domstr = `<div class="loading">
                	<div id="speedOfProgress"></div>
                	<p></p>
                </div>
                <img src="${loadingImgBase64}" class="loadingTip">
                <div id="speedOfProgress"></div>
                <!-- LRAP -->
                <div class="orientationMarkers">
                    <div class="mrtopmiddle orientationMarkerDiv">
                    </div>
                    <div class="mrrightmiddle orientationMarkerDiv">
                    </div>
                    <div class="mrbottommiddle orientationMarkerDiv">
                    </div>
                    <div class="mrleftmiddle orientationMarkerDiv">
                    </div>
                </div>`;
	return $(domstr);
}

// 动态向DOM中拼接显示宫格布局
function dicomImageWrapGenerator(wrapKindarg) {
	let wrapKind = wrapKindarg || "r1_c1";
	/*现阶段分为4类布局(row_column)
	  1.1 1*1整体大布局 wrapKind(r1_c1)
	  1.2 1*2布局(左右排布) wrapKind(r1_c2)
	  1.3 2*1布局(上下排布) wrapKind(r2_c1)
	  1.4 2*2布局 wrapKind(r2_c2)
	*/
	if(wrapKind === 'r2_c1') {
		//创建内部节点
		let innerDom1 = dicomInnerInfo("r1_c1");
		let innerDom2 = dicomInnerInfo("r2_c1");
		let WrapDom1Str = `<div id="dicomImage_r1_c1" data-order='1' class="dicClass"></div>`
		let WrapDom1 = $(WrapDom1Str).append(innerDom1).css({
			width: "99.9%",
			height: "49.8%"
		});
		let WrapDom2Str = `<div id="dicomImage_r2_c1" data-order='2' class="dicClass"></div>`
		let WrapDom2 = $(WrapDom2Str).append(innerDom2).css({
			width: "99.9%",
			height: "49.8%"
		});
		$("#dicomDiv").append(WrapDom1).append(WrapDom2);
	} else {
		//获得数量
		let rowNum = wrapKind.split("")[1];
		let columnNum = wrapKind.split("")[4];
		let wrapNum = rowNum * columnNum;
		//计算获得宽高的百分比
		let cssWidth;
		let cssHeight;
		
		if((1 / rowNum).toString().length > 5) {
			let percentRow = (1 / rowNum) * 100;
			cssHeight = percentRow.toString().split(0, percentRow.indexOf(".") + 2) + "%";
		} else {
			cssHeight = (1 / rowNum) * 100 + "%";
		}
		
		if((1 / columnNum).toString().length > 5) {
			let percentCol = (1 / columnNum) * 100;
			cssWidth = percentCol.toString().split(0, percentCol.indexOf(".") + 2) + "%";
		} else {
			cssWidth = (1 / columnNum) * 100 + "%";
		}
		
		for(var i = 1; i <= wrapNum; i++) {
			let innerDom = dicomInnerInfo(i);
			let WrapDomStr = `<div id="dicomImage_${i}" class="dicClass" data-order='${i}'></div>`
			let WrapDom = $(WrapDomStr).append(innerDom).css({
				width: cssWidth,
				height: cssHeight
			});
			$("#dicomDiv").append(WrapDom);
		}
	}
}

